st.write(' ## Propiedades del coeficiente de Pearson')

st.write(' - **Adimensionalidad**')
# 
st.write(' Al dividir la suma de cuadrados del producto XY entre las raíces individuales de las sumas de cuadrados de X y Y, se obtiene un índice sin dimensiones que se origina cuando las unidades del numerador se cancelan con las del denominador. Esta propiedad representa una ventaja esencial que hace de este coeficiente una medida versátil y fácilmente interpretable (Hernández et al., 2018).')

st.write(' - **Rango definido entre -1 y 1**')
# 
st.write(' Este coeficiente puede entenderse como el coseno del ángulo formado por los vectores asociados a X y Y. Cuando dicho ángulo es cercano a 0, el coseno tiende a 1, lo que implicaría que las variables poseen una alta proximidad en el espacio. Situación similar se presenta cuando el ángulo es aproximadamente igual a 180, en cuyo caso, el coseno será igual a -1 e indicará que las variables siguen exhibiendo una elevada cercanía, pero en direcciones opuestas. Ahora bien, cuando el ángulo entre los vectores es de 90 grados o similar, el coseno tenderá a 0 y esto supondrá que las variables son ortogonales, y que, en consecuencia, no están relacionadas linealmente (Hernández et al., 2018).')

st.write(' - **Relación lineal**')
# 
st.write(' Esta propiedad es una de las más importantes y tal vez sea en la que más errores # de interpretación se comenten. Es fundamental distinguir que lo que mide el coeficiente de Pearson es la fuerza y la dirección de la relación lineal entre las variables. Así, un $r_{XY}$ = ± $1r_{XY}$ = ± 1 indicará que hay una perfecta asociación lineal positiva o negativa – según sea el signo – entre X y Y. En este orden de ideas, un $r_{XY}$ = $0r_{XY}$ = 0 será evidencia de que no existe relación lineal entre las características de interés, pero no constituye prueba alguna de independencia. En otras palabras, si el coeficiente de correlación es nulo, únicamente se podría establecer que no hay asociación lineal entre las variables, aunque pueda existir otro tipo de vinculación (Hernández et al., 2018).')

st.write(' - **Simetría**')
# 
st.write(' La simetría en este caso establece que, sin importar si se intercambian las posiciones de X y Y, el resultado del coeficiente será el mismo. En términos matemáticos, esto podría expresarse a través de la igualdad $r_{XY}$ = $r_{YX}$  $r_{XY}$ = $r_{YX}$, lo que a su vez implica que al realizar una análisis de correlación, ninguna de las características de interés debe asumirse como explicativa de la otra (Hernández et al., 2018).')

st.write(' - **Independencia con respecto al origen y a la escala**')
# 
st.write(' El valor de r de Pearson una vez ha sido calculado, no cambiará a pesar de que se modifique el origen o la escala de los datos; es decir, el coeficiente no se ve afectado por aquellas transformaciones lineales que se apliquen a las variables. En palabras simples, sumar o restar constantes uniformemente a cada variable no alterará el resultado, lo mismo si se multiplica o divide (Hernández et al., 2018).')

st.write(' ### Suposiciones Vinculadas Al Uso Del Coeficiente De Pearson')

st.write(' El uso adecuado de este coeficiente debe sustentarse en el cumplimiento de las siguientes premisas:')

st.write(' - **Nivel de medición de las variables**')
# 
st.write(' Las dos variables deben ser de intervalo o de razón, aunque no es necesario que ambas tengan el mismo nivel de medición.')

st.write(' - **Datos pareados**')
# 
st.write(' Para que el cálculo de esta medida pueda realizarse, se necesitará que los casos en cuestión tengan datos en cada variable. Si hay valores perdidos, estos registros se descartarán por completo del análisis.')

st.write(' - **Normalidad bivariada**')
# 
st.write(' Contrario a lo que sucede en muchas investigaciones en las que se comprueba únicamente la normalidad marginal de X y Y, el uso apropiado del coeficiente de correlación de Pearson exige que se satisfaga el supuesto de normalidad bivariada; esto es, que la distribución de probabilidad conjunta de X y Y sea normal.')

st.write(' - **Ausencia de datos atípicos a nivel bivariado**')
# 
st.write(' Tal y como sucede con el supuesto anterior, la conjetura relacionada con la presencia de datos atípicos a nivel multivariado suele ser malinterpretada y verificada erróneamente.')

