# In[ ]:


import numpy as np
import math
sml = []

def correlation(x,y):
    mdx = x.mean()
    mdy = y.mean()
    numerador = np.sum((x-mdx)*(y-mdy))
    denominador = np.sqrt(np.sum((x-mdx)**2)*np.sum((y-mdy)**2))
    r = numerador/denominador
    return r

